import React, { useState, useContext } from "react";
import RobotGenerator from "./RobotGenerator";
import {addonObjContext} from "../Contexts/AddonObjContext.jsx";
import "../Styles/Map.scss";

// import cloud from "../resources/cloud.png";
import mountains from "../resources/mountains3.png";
import water from "../resources/water2.png";
import housing from "../resources/housing.png";

export default function Map(){
    const  [state] = useContext(addonObjContext)

    return (
        <div className="map">

                <RobotGenerator />
                if (state.water)
                <img src={state.water.imgSrc[state.water.imgShowing]} className="cloud" alt="cloud" />
                <img src={state.water.imgSrc[state.water.imgShowing]}  className="water" alt="water" />
                <img src={housing} className="housing" alt="" />

            <div className="planet">
            <img src={mountains} className="mountains" alt="" />


            </div>

        </div>
    )

};
